TicketResponse::ActionTypeEnum TicketResponse::toActionTypeEnum(const utility::string_t& value) const
{
    
    if (value == utility::conversions::to_string_t("COMPLETED")) {
        return ActionTypeEnum::COMPLETED;
    }
    
    if (value == utility::conversions::to_string_t("REDEEMED")) {
        return ActionTypeEnum::REDEEMED;
    }
    
    if (value == utility::conversions::to_string_t("USERS_PLAYED")) {
        return ActionTypeEnum::USERS_PLAYED;
    }
    
    if (value == utility::conversions::to_string_t("TOURNAMENT_OWNER")) {
        return ActionTypeEnum::TOURNAMENT_OWNER;
    }
    
    if (value == utility::conversions::to_string_t("PURCHASED")) {
        return ActionTypeEnum::PURCHASED;
    }
    
    if (value == utility::conversions::to_string_t("SUMATION")) {
        return ActionTypeEnum::SUMATION;
    }
    
    if (value == utility::conversions::to_string_t("GIFTED")) {
        return ActionTypeEnum::GIFTED;
    }
    
    if (value == utility::conversions::to_string_t("REFUNDED")) {
        return ActionTypeEnum::REFUNDED;
    }
    
    throw std::invalid_argument("Invalid value for conversion to ActionTypeEnum");
}


const utility::string_t TicketResponse::fromActionTypeEnum(const ActionTypeEnum value) const
{
    switch(value)
    {
        
        case ActionTypeEnum::COMPLETED: return utility::conversions::to_string_t("COMPLETED");
        
        case ActionTypeEnum::REDEEMED: return utility::conversions::to_string_t("REDEEMED");
        
        case ActionTypeEnum::USERS_PLAYED: return utility::conversions::to_string_t("USERS_PLAYED");
        
        case ActionTypeEnum::TOURNAMENT_OWNER: return utility::conversions::to_string_t("TOURNAMENT_OWNER");
        
        case ActionTypeEnum::PURCHASED: return utility::conversions::to_string_t("PURCHASED");
        
        case ActionTypeEnum::SUMATION: return utility::conversions::to_string_t("SUMATION");
        
        case ActionTypeEnum::GIFTED: return utility::conversions::to_string_t("GIFTED");
        
        case ActionTypeEnum::REFUNDED: return utility::conversions::to_string_t("REFUNDED");
        
    }
}


